%[text] ## Crear el robot
robot_trayectories = erobotics_interface() %[output:297dddec] %[output:83b7298f]
fprintf('robot inizializado') %[output:84a77018]
%%
%[text] ## Iniciar visualización de las Joints
robot_trayectories.verDatos(true) %[output:8d092cb4] %[output:941cea32]
%%
%[text] ## Llevar robot a posición inicial
robot_trayectories.moverRobot([0, 0, 0, 0, 0, 45], 2) %[output:66831302]
%%
%[text] ## Definir posición deseada
J1 = 30 %[control:slider:2406]{"position":[6,8]} %[output:57ecb4d1]
J2 = 0 %[control:slider:00dc]{"position":[6,7]} %[output:151dec3a]
J3 = -45 %[control:slider:9bd1]{"position":[6,9]} %[output:242760e5]
J4 = 35 %[control:slider:4837]{"position":[6,8]} %[output:300368c1]
J5 = 0 %[control:slider:9e07]{"position":[6,7]} %[output:70e474db]
J6 = -30 %[control:slider:53f5]{"position":[6,9]} %[output:4ce28219]
%%
%[text] ## Mover a posición deseada
angles = [J1, J2, J3, J4, J5, J6];
robot_trayectories.moverRobot(angles, 2); %[output:08ce151a]
%%
%[text] ## Borrar el robot
delete(robot_trayectories);

